import React from "react";
import { Text, Box, Container, Center } from "native-base";
import { Dimensions } from "react-native-web";
import Animated, {
  useAnimatedStyle,
  useSharedValue,
} from "react-native-reanimated";

const { width, height } = Dimensions.get("window");

const App = () => {
  const menuPositionY = useSharedValue(OFF_SCREEN);

  const AnimatedBoxStyle = useAnimatedStyle(() => {
    return {
      position: "absolute",
      backgroundColor: "black",
      height,
      zIndex: 50,
      width,
      transform: [
        {
          translateY: menuPositionY.value,
        },
      ],
    };
  });
  return (
    <Box w={width} h={height} bg="dark.100">
      <Animated.View style={AnimatedBoxStyle} />
    </Box>
  );
};

export default App;
